import { VictoryLine, VictoryChart, VictoryAxis } from "victory";
import { bgColor3e } from "../../Styles/backGroundColor";

export function DefaultLineChart(props){
    const {border="10px solid #ccc", data=[ { x: 1, y: 2 }, { x: 2, y: 3 }, { x: 3, y: 5 }, { x: 4, y: 4 }, { x: 5, y: 7 } ],
            interpolation="basis", bg=bgColor3e} = props

    return (
    <VictoryChart minDomain={{ y: 0 }} style={{background: { fill:bg}}}>
        
        <VictoryAxis crossAxis={true}
        // Hier kannst du die Beschriftung f端r die x-Achse anpassen
        // Zum Beispiel: Beschriftung auf "X-Achse" setzen
        label="X-Achse"
        // Hier kannst du das Aussehen der Achse anpassen
        style={{
          axisLabel: { padding: 30 },
          tickLabels: { fontSize: 10 }
        }}
      />
      <VictoryAxis
        dependentAxis
        // Hier kannst du die Beschriftung f端r die y-Achse anpassen
        // Zum Beispiel: Beschriftung auf "Y-Achse" setzen
        label="Y-Achse"
        // Hier kannst du das Aussehen der Achse anpassen
        style={{
          axisLabel: { padding: 40 },
          tickLabels: { fontSize: 10 }
        }}
      />
        
        <VictoryLine 
            animate={{
                duration: 2000,
                onLoad: { duration: 2000 }}}
            style={{data: {stroke:props.lineColor, parent: { border:{border}}}}}
            interpolation={interpolation}
            data={data}/>
    </VictoryChart>)
}
